export default "import React, { useEffect, useState } from \"react\";\nimport Slider from \"@material-ui/core/Slider\";\n// import Jinno from \"jinno\";\nimport variables from \"../../../variables\";\n\nconst SliderDemo = (props) => {\n  const [value, setValue] = useState(props.value);\n  let style = { color: props.color };\n\n  useEffect(() => {\n    if (props.value !== value) {\n      setValue(props.value);\n    }\n    // eslint-disable-next-line react-hooks/exhaustive-deps\n  }, [props.value ? props.value : \"\"]);\n\n  const onChange = (e, newValue) => {\n    setValue(newValue);\n  };\n\n  return (\n    <div style={props.orientation === \"vertical\" ? { height: \"200px\" } : {}}>\n      <Slider style={style} {...props} value={value} onChange={onChange} />\n    </div>\n  );\n};\n\nexport default SliderDemo;\n/*remove*/\n// if (variables.env === \"web\" && variables.isDev) {\n//     Jinno(Slider, \"Slider\");\n// }\n/*remove*/\n";